import{_ as e}from"./plugin-vue_export-helper.21dcd24c.js";import{o as a,c as r,a as t}from"./app.83201bd9.js";var s="/notes/assets/jsInterview/jsInterviewQuestion/360a7f2a28cd41ef8855d17aa9894123_tplv-k3u1fbpfcp-watermark.png",p="/notes/assets/jsInterview/jsInterviewQuestion/010d21e3fc854903aa3527e45fc9d511_tplv-k3u1fbpfcp-watermark.png",d="/notes/assets/jsInterview/jsInterviewQuestion/d454333bf63b48fcb7ee73c722cdc9f6_tplv-k3u1fbpfcp-watermark.png",i="/notes/assets/jsInterview/jsInterviewQuestion/f5a37e4a16d64143b5e51ebdfd63ecc6_tplv-k3u1fbpfcp-watermark.png",o="/notes/assets/jsInterview/jsInterviewQuestion/883a238b0b344f319ab2917ace625167_tplv-k3u1fbpfcp-watermark.png";const c={},n=t('<h1 id="\u7B2C19\u9898-\u4E86\u89E3\u4F4E\u4EE3\u7801" tabindex="-1"><a class="header-anchor" href="#\u7B2C19\u9898-\u4E86\u89E3\u4F4E\u4EE3\u7801" aria-hidden="true">#</a> \u7B2C19\u9898\uFF1A\u4E86\u89E3\u4F4E\u4EE3\u7801</h1><h2 id="\u4F4E\u4EE3\u7801\u7A76\u7ADF\u662F\u4EC0\u4E48" tabindex="-1"><a class="header-anchor" href="#\u4F4E\u4EE3\u7801\u7A76\u7ADF\u662F\u4EC0\u4E48" aria-hidden="true">#</a> \u4F4E\u4EE3\u7801\u7A76\u7ADF\u662F\u4EC0\u4E48</h2><p>\u8FD9\u4E9B\u5E74\uFF0C\u81EA\u4ECE <code>SaaS\uFF08Software-as-a-Service\uFF09 \u5382\u5546 Salesforce</code> \u5E02\u503C\u6C34\u6DA8\u8239\u9AD8\uFF0C\u8FD8\u548C\u5176\u5927\u624B\u7B14\u7684\u5546\u4E1A\u5E76\u8D2D\u6848\uFF0C\u9010\u6E10\u5F15\u8D77\u4E86\u56FD\u5185\u4E92\u8054\u7F51\u884C\u4E1A\u4EBA\u7684\u5173\u6CE8\uFF0C\u4E60\u60EF\u8FDB\u884C\u56FD\u5185\u5916\u4EA7\u54C1\u5BF9\u6807\u7684\u4E92\u8054\u7F51\u5708\u5B50\u5174\u8D77\u4E86\u4E00\u80A1 <code>SaaS</code> \u98CE\u6F6E\uFF0C\u5728\u540E\u79FB\u52A8\u4E92\u8054\u7F51\u65F6\u4EE3\u4E0B\uFF0C\u90E8\u5206\u4EBA\u4E5F\u671F\u5F85 <code>SaaS</code> \u53EF\u4EE5\u6210\u4E3A\u56FD\u5185\u4E92\u8054\u7F51\u7684\u4E00\u4E2A\u65B0\u589E\u957F\u70B9\u3002</p><p>\u968F\u7740\u4E0D\u540C\u7684\u7528\u6237\u8BC9\u6C42\uFF0C\u4E00\u4E9B\u7CFB\u7EDF\u884D\u751F\u51FA\u65B0\u7684\u5F62\u6001\uFF0C\u4E0D\u540C\u4E8E\u65E2\u5B9A\u7684 <code>SaaS</code> \u4EA7\u54C1\u5F62\u6001\uFF0C\u7528\u6237\u53EF\u4EE5\u901A\u8FC7\u53EF\u89C6\u5316\u62D6\u62FD\u754C\u9762\u3001\u8868\u5355\u914D\u7F6E\u7B49\u65B9\u5F0F\uFF0C\u5FEB\u901F\u5B9A\u5236\u51FA\u4E00\u4E2A\u5B8C\u6574\u7684\u5E94\u7528\uFF0C\u800C\u4E14\u8FD9\u4E00\u7C7B\u7CFB\u7EDF\u57FA\u672C\u4E0D\u7528\u7F16\u5199\u592A\u591A\u7684\u4EE3\u7801\uFF0C\u5373\u53EF\u4EE5\u5B9E\u73B0\u5B9A\u5236\u5316\u5E94\u7528\u3002\u968F\u7740\u8FD9\u4E00\u5F62\u6001\u7684\u7CFB\u7EDF\u8D8A\u6765\u8D8A\u591A\uFF0C\u4E45\u800C\u4E45\u4E4B\uFF0C\u5927\u5BB6\u5C31\u5F62\u8C61\u5730\u79F0\u4E4B\u4E3A**\u201D\u4F4E\u4EE3\u7801\u201D\uFF08<code>low-code</code>\uFF09**\uFF0C\u53E6\u5916\u4E5F\u6709\u4EBA\u79F0\u4E4B\u4E3A <code>\u201DaPaaS\u201C</code>\uFF0C\u5373\u5E94\u7528\u5E73\u53F0\u5373\u670D\u52A1\uFF08\u5C5E\u4E8E\u662F\u4E92\u8054\u7F51\u9020\u8BCD\u8001\u6280\u80FD\u4E86...\uFF09\u3002</p><p>\u4F4E\u4EE3\u7801\u8FD9\u4E2A\u6982\u5FF5\u771F\u6B63\u706B\u70ED\u8D77\u6765\uFF0C\u8FD8\u662F\u5728\u4E8E\u8FD9\u4E24\u5E74 Outsystems \u76F8\u7EE7\u5B8C\u6210\u4E86\u6570\u8F6E\u8FC7\u4EBF\u5143\u7F8E\u91D1\u7684\u878D\u8D44\uFF0C\u4F30\u503C\u65E9\u65E9\u5730\u7AD9\u4E0A\u4E86\u5341\u4EBF\u7F8E\u91D1\u7EA7\u522B\uFF0C\u6210\u4E3A\u4E00\u65B9\u72EC\u89D2\u517D\u3002\u7531\u4E8E\u56FD\u5185\u8FD9\u4E00\u9886\u57DF\u7F3A\u5C11\u4F53\u91CF\u5BF9\u7B49\u7684\u5382\u5546\uFF0C\u6240\u4EE5\u5927\u5BB6\u81EA\u7136\u4E5F\u5728\u671F\u5F85\u54EA\u5BB6\u5382\u5546\u80FD\u6210\u957F\u4E3A\u4E2D\u56FD\u7684 Outsystems\u3002\u4E0E\u6B64\u540C\u65F6\uFF0C\u56FD\u5185\u4F4E\u4EE3\u7801\u8D5B\u9053\u4E0A\u9009\u624B\u4E5F\u6E10\u6E10\u8FDB\u5165\u4E86\u5927\u5BB6\u7684\u89C6\u91CE\uFF0C\u4F8B\u5982\u9489\u9489\u5B9C\u642D\u3001\u5373\u523B\u5E94\u7528\u3001\u6C1A\u4E91\u3001\u7B80\u9053\u4E91\u7B49\u7B49\u3002</p><p><img src="'+s+'" alt="demo"></p><h2 id="\u4F4E\u4EE3\u7801\u7CFB\u7EDF\u957F\u4EC0\u4E48\u6837" tabindex="-1"><a class="header-anchor" href="#\u4F4E\u4EE3\u7801\u7CFB\u7EDF\u957F\u4EC0\u4E48\u6837" aria-hidden="true">#</a> \u4F4E\u4EE3\u7801\u7CFB\u7EDF\u957F\u4EC0\u4E48\u6837</h2><p>\u867D\u7136\u4F4E\u4EE3\u7801\u5E73\u53F0\u7684\u5F62\u6001\u5F88\u591A\uFF0C\u4F46\u662F\u5176\u4E2D\u7684\u6838\u5FC3\u8FD8\u662F\u8131\u79BB\u4E0D\u5F00\u7F16\u7A0B\u601D\u60F3\uFF0C\u57FA\u672C\u90FD\u6709\u4EE5\u4E0B\u529F\u80FD\u6A21\u5757\uFF1A\u9875\u9762\u642D\u5EFA\u3001\u6570\u636E\u903B\u8F91\u3001\u6570\u636E\u6A21\u578B\uFF0C\u5728\u7EBF\u90E8\u7F72\u548C\u7BA1\u7406\u7CFB\u7EDF\u3002\u6839\u636E\u4E0D\u540C\u7684\u4E1A\u52A1\u573A\u666F\uFF0C\u5177\u4F53\u7684\u5E73\u53F0\u5F62\u6001\u5206\u5316\u4E3A\u8868\u5355/\u6570\u636E\u6A21\u578B\u9A71\u52A8\u3001\u754C\u9762\u9A71\u52A8\u7B49\u5F62\u6001\u3002</p><h3 id="\u8868\u5355-\u6570\u636E\u6A21\u578B\u9A71\u52A8" tabindex="-1"><a class="header-anchor" href="#\u8868\u5355-\u6570\u636E\u6A21\u578B\u9A71\u52A8" aria-hidden="true">#</a> \u8868\u5355/\u6570\u636E\u6A21\u578B\u9A71\u52A8</h3><p>\u8868\u5355/\u6570\u636E\u6A21\u578B\u9A71\u52A8\u662F\u56F4\u7ED5\u6570\u636E\u7ED3\u6784\u6765\u5B9A\u4E49\u6574\u4E2A\u5E94\u7528\u7684\u5F62\u6001\u548C\u6D41\u7A0B\uFF0C\u5176\u4E2D\u8868\u5355\u9A71\u52A8\u6307\u7528\u6237\u901A\u8FC7\u914D\u7F6E\u8868\u5355\u754C\u9762\uFF0C\u5143\u7D20\u5927\u591A\u662F\u6587\u672C\u8F93\u5165\u3001\u4E0B\u62C9\u9009\u62E9\u5668\u3001\u65E5\u671F\u9009\u62E9\u5668\u7B49\u7EC4\u4EF6\uFF0C\u914D\u7F6E\u8868\u5355\u754C\u9762\u540E\u81EA\u52A8\u751F\u6210\u6570\u636E\u6A21\u578B\uFF0C\u5E76\u57FA\u4E8E\u8BE5\u8868\u5355\u505A\u6570\u636E\u53CA\u6D41\u7A0B\u7BA1\u7406\uFF0C\u800C\u6570\u636E\u6A21\u578B\u9A71\u52A8\u5219\u66F4\u590D\u6742\uFF0C\u9700\u8981\u7528\u6237\u8FDB\u884C\u6570\u636E\u5EFA\u6A21\u548C\u5B9A\u4E49\u6A21\u578B\u5173\u7CFB\uFF0C\u6B64\u64CD\u4F5C\u548C SQL \u6570\u636E\u5E93\u642D\u5EFA\u7C7B\u4F3C\uFF0C\u914D\u7F6E\u4E3B\u952E\u3001\u7D22\u5F15\uFF0C\u7C7B\u578B\u7B49\u7B49\uFF0C\u7136\u540E\u57FA\u4E8E\u8BE5\u6570\u636E\u8868\u5355\u642D\u5EFA\u4E0A\u5C42\u7684\u7BA1\u7406\u7CFB\u7EDF\u3002\u8BE5\u6A21\u5F0F\u6BD4\u8F83\u591A\u5E94\u7528\u5728\u642D\u5EFA CRM\u3001ERP \u7B49\u7BA1\u7406\u7CFB\u7EDF\u3002</p><h3 id="\u754C\u9762\u9A71\u52A8" tabindex="-1"><a class="header-anchor" href="#\u754C\u9762\u9A71\u52A8" aria-hidden="true">#</a> \u754C\u9762\u9A71\u52A8</h3><p>\u754C\u9762\u9A71\u52A8\u6BD4\u8F83\u597D\u7406\u89E3\uFF0C\u5C31\u662F\u7528\u6237\u901A\u8FC7\u62D6\u62FD\u7EC4\u4EF6\u65B9\u5F0F\u53EF\u89C6\u5316\u642D\u5EFA\u754C\u9762\uFF0C\u7136\u540E\u914D\u7F6E\u9875\u9762\u7684\u4EA4\u4E92\u903B\u8F91\uFF0C\u6BD4\u5982\u9875\u9762\u7684\u8DF3\u8F6C\u3001\u6570\u636E\u83B7\u53D6\u7B49\u7B49\u3002\u8FD9\u79CD\u5F62\u5F0F\u5927\u591A\u5E94\u7528\u5728\u642D\u5EFA\u901A\u7528\u7A0B\u5E8F\u7684\u4F4E\u4EE3\u7801\u5E73\u53F0</p><p><img src="'+p+'" alt="demo"></p><p>\u8FD9\u79CD\u6A21\u5F0F\u4E0E\u7AEF\u5E94\u7528\u5F00\u53D1\u7684\u5957\u8DEF\u57FA\u672C\u4E00\u81F4\uFF0C\u53EA\u662F\u5C06\u4EE3\u7801\u7F16\u8F91\u4FEE\u6539\u4E3A\u753B\u5E03\u62D6\u62FD\u548C\u8868\u5355\u914D\u7F6E\u3002\u8FD9\u91CC\u4E3E\u4E00\u4E2A\u7B80\u5355\u7684\u4F8B\u5B50\uFF0C\u5728\u754C\u9762\u6309\u94AE\u8BBE\u7F6E\u4E00\u4E2A\u70B9\u51FB\u4E8B\u4EF6\uFF0C\u4E8B\u4EF6\u903B\u8F91\u4E3A\u62C9\u53D6\u6570\u636E\u3002\u8BE5\u6D41\u7A0B\u5C31\u662F\u5C06\u7F16\u7A0B\u6982\u5FF5\u63D0\u53D6\u4E3A\u4EA4\u4E92\u8868\u5355\u64CD\u4F5C\uFF0C\u91CC\u9762\u8FD8\u662F\u4F1A\u51FA\u73B0\u5165\u53C2\u51FA\u53C2\u5B57\u6BB5\u3001\u56DE\u8C03\u7B49\u7B49\u6982\u5FF5\uFF0C\u9075\u5FAA\u7F16\u7A0B\u7684\u601D\u60F3\u3002</p><p><img src="'+d+'" alt="demo"></p><p>\u5F53\u7528\u6237\u5C06\u5E94\u7528\u642D\u5EFA\u5B8C\u6210\u540E\uFF0C\u53EF\u4EE5\u76F4\u63A5\u5728\u5E73\u53F0\u4E0A\u5B8C\u6210\u53D1\u5E03\u5DE5\u4F5C\uFF0C\u7136\u540E\u5C31\u53EF\u4EE5\u901A\u8FC7\u7ED9\u51FA\u7684\u94FE\u63A5\u8BBF\u95EE\u5E94\u7528\uFF08\u5927\u591A\u6570\u4F4E\u4EE3\u7801\u5E73\u53F0\u5236\u4F5C\u51FA\u6765\u90FD\u662F web \u5E94\u7528\uFF09\u3002</p><p>\u4F4E\u4EE3\u7801\u6982\u5FF5\u867D\u7136\u6BD4\u8F83\u65B0\u9896\uFF0C\u4F46\u662F\u4F4E\u4EE3\u7801\u5E73\u53F0\u5DF2\u7ECF\u53D1\u5C55\u4E86\u5F88\u4E45\u4E86\uFF08<code>Outsystems</code> \u5EFA\u7ACB\u4E8E 2001 \u5E74\uFF0C\u56FD\u5185\u7684\u9053\u4E00\u4E91\u5EFA\u7ACB\u4E8E 2004 \u5E74\uFF09\u3002\u603B\u4F53\u6765\u8BF4\uFF0C\u7ECF\u8FC7\u8FD9\u4E9B\u5E74\u7684\u53D1\u5C55\u63A2\u7D22\uFF0C\u4F4E\u4EE3\u7801\u5E73\u53F0\u7684\u5F62\u6001\u4E5F\u8D8B\u4E8E\u7A33\u5B9A\uFF0C\u5404\u5BB6\u7684\u521B\u65B0\u4E5F\u662F\u57FA\u4E8E\u9762\u5BF9\u7684\u7528\u6237\u573A\u666F\u800C\u505A\u7684\u5FAE\u521B\u65B0\uFF0C\u672C\u8D28\u4E0A\u4E5F\u6CA1\u6709\u8DF3\u8131\u51FA\u7F16\u7A0B\u601D\u60F3\u3002</p><h2 id="\u4F4E\u4EE3\u7801\u600E\u4E48\u505A\u4E2A\u6027\u5316\u5B9A\u5236" tabindex="-1"><a class="header-anchor" href="#\u4F4E\u4EE3\u7801\u600E\u4E48\u505A\u4E2A\u6027\u5316\u5B9A\u5236" aria-hidden="true">#</a> \u4F4E\u4EE3\u7801\u600E\u4E48\u505A\u4E2A\u6027\u5316\u5B9A\u5236</h2><p>\u8FD9\u91CC\u6709\u540C\u5B66\u4F1A\u95EE\u4E86\uFF0C\u4F4E\u4EE3\u7801\u5E73\u53F0\u600E\u4E48\u6EE1\u8DB3\u4E2A\u6027\u5316\u9700\u6C42\uFF1F\u8BDA\u7136\uFF0C\u53D7\u9650\u4E8E\u4F4E\u4EE3\u7801\u5E73\u53F0\u6240\u63D0\u4F9B\u7684\u7EC4\u4EF6\u548C\u903B\u8F91\u914D\u7F6E\u8868\u5355\uFF0C\u53EA\u80FD\u89E3\u51B3\u4E00\u4E9B\u901A\u7528\u5316\u573A\u666F\uFF0C\u5F53\u7528\u6237\u7684\u8BC9\u6C42\u8D85\u8131\u51FA\u8FD9\u4E2A\u5708\u5708\u65F6\uFF0C\u662F\u4E0D\u662F\u5C31\u65E0\u80FD\u4E3A\u529B\u4E86\uFF1F\u5546\u4E1A\u516C\u53F8\u80AF\u5B9A\u4E0D\u4F1A\u8FD9\u4E48\u5E7C\u7A1A\uFF0C\u4EE5\u4E0B\u7B80\u5355\u5217\u4E3E\u641C\u96C6\u5230\u7684\u4E00\u4E9B\u4E2A\u6027\u5316\u5B9A\u5236\u7684\u65B9\u6CD5\uFF1A</p><ol><li><p>\u7528\u6237\u53EF\u4EE5\u5728\u5E73\u53F0\u5B9A\u5236\u7684\u89C4\u5219\u4E0B\u5F55\u5165\u7EC4\u4EF6</p></li><li><p>\u63D0\u4F9B API \u8BBF\u95EE\u6570\u636E\u5E93</p></li><li><p>\u751F\u6210\u6E90\u4EE3\u7801\u505A\u4E8C\u6B21\u5F00\u53D1\uFF08\u4F4E\u4EE3\u7801\u53D8\u4EE3\u7801\u4E86...\uFF09</p></li><li><p>\u586B\u5199\u53CD\u9988\u7B49\u5E73\u53F0\u66F4\u65B0</p></li></ol><p><img src="'+i+'" alt="demo"></p><h2 id="\u4F4E\u4EE3\u7801\u6709\u6CA1\u6709\u7528" tabindex="-1"><a class="header-anchor" href="#\u4F4E\u4EE3\u7801\u6709\u6CA1\u6709\u7528" aria-hidden="true">#</a> \u4F4E\u4EE3\u7801\u6709\u6CA1\u6709\u7528\uFF1F</h2><p>\u201C\u4F4E\u4EE3\u7801\u7A76\u7ADF\u6709\u6CA1\u6709\u7528\uFF1F\u201D</p><p>\u8FD9\u4E2A\u95EE\u9898\u6D6E\u73B0\u5728\u5404\u4E2A\u8BBA\u575B\u4E0A\u3002\u8FD9\u4E2A\u95EE\u9898\u53EF\u4EE5\u7406\u89E3\u4E3A\u4F4E\u4EE3\u7801\u7684\u58F0\u91CF\u548C\u5176\u80FD\u529B\u4E0D\u5339\u914D\uFF0C\u7528\u6237\u5BF9\u4F4E\u4EE3\u7801\u4FE1\u5FC3\u4E0D\u8DB3\u3002\u5BF9\u4E8E\u76EE\u524D\u4F4E\u4EE3\u7801\u5E73\u53F0\u7684\u95EE\u9898\uFF0C\u5B58\u5728\u4E3B\u89C2\u548C\u5BA2\u89C2\u7684\u56E0\u7D20\u3002</p><p>\u9996\u5148\u5F88\u591A<strong>\u4F4E\u4EE3\u7801\u5E73\u53F0\u80FD\u529B\u8FD8\u6CA1\u6709\u8DB3\u591F\u5B8C\u5584\u6210\u719F</strong>\uFF0C\u8FD9\u662F\u4E00\u4E2A\u5F88\u6838\u5FC3\u7684\u56E0\u7D20\u3002\u5BF9\u4E8E\u5F88\u591A\u521D\u6B21\u4F7F\u7528\u7684\u7528\u6237\u6765\u8BF4\uFF0C\u6982\u5FF5\u7E41\u591A\uFF0C\u903B\u8F91\u590D\u6742\uFF0C\u5728\u4E00\u756A\u4F53\u9A8C\u4EE5\u540E\uFF0C\u9884\u671F\u548C\u5B9E\u9645\u6709\u843D\u5DEE\u3002\u4F7F\u7528\u8D77\u6765\u603B\u4F53\u8017\u65F6\u8DDF\u6E90\u7801\u5F00\u53D1\u76F8\u5DEE\u65E0\u51E0\uFF0C\u663E\u5F97\u5DE5\u5177\u6BD4\u8F83\u9E21\u808B\u3002\u5BA2\u89C2\u4E0A\uFF0C\u56FD\u5185\u7684\u4EBA\u529B\u8D44\u6E90\u60C5\u51B5\u76F8\u6BD4\u6B27\u7F8E\u8FD8\u662F\u6BD4\u8F83\u4FBF\u5B9C\uFF0C\u5F88\u591A\u6709\u5B9A\u5236\u5E94\u7528\u8BC9\u6C42\u7684\u5BA2\u6237\uFF0C\u9996\u5148\u4F1A\u60F3\u5230\u7684\u662F\u627E\u5916\u5305\uFF0C\u6216\u8005\u62DB\u8058\u5F00\u53D1\u5C97\u4F4D\uFF0C\u800C\u4E0D\u662F\u627E\u4F4E\u4EE3\u7801\u5DE5\u5177\u81EA\u5DF1\u52A8\u624B\u3002\u53E6\u5916\u5927\u5BB6\u5BF9\u4E8E\u4F4E\u4EE3\u7801\u7684\u8BA4\u77E5\u4E5F\u8FD8\u4E0D\u8DB3\uFF0C\u5F88\u96BE\u6210\u4E3A\u4E00\u4E2A\u5907\u9009\u9879\u3002</p><p>\u601D\u8003\u8FD9\u4E2A\u95EE\u9898\uFF0C\u6211\u4EEC\u60F3\u4E00\u4E2A\u7B80\u5355\u95EE\u9898\uFF0C\u201C\u4E00\u4E2A\u53EF\u4EE5\u964D\u4F4E\u95E8\u69DB\uFF0C\u63D0\u9AD8\u6548\u7387\u7684\u5DE5\u5177\u6709\u6CA1\u6709\u7528\u201D\uFF0C\u7B54\u6848\u5F88\u663E\u7136\u662F\u80AF\u5B9A\u7684\u3002<strong>\u4F4E\u4EE3\u7801\u5E73\u53F0\u7684\u5B97\u65E8\uFF0C\u4E0D\u5C31\u662F\u201C\u964D\u4F4E\u95E8\u69DB\u201D\uFF0C\u201C\u964D\u672C\u589E\u6548\u201D\u4E48\u3002</strong></p><p>\u4E2A\u4EBA\u89C9\u5F97\uFF0C\u8FD9\u4E9B\u95EE\u9898\u5927\u6982\u662F\u65F6\u95F4\u7684\u95EE\u9898\u3002\u5C31\u76EE\u524D\u5E02\u9762\u4E0A\u7684\u4F4E\u4EE3\u7801\u5DE5\u5177\u800C\u8A00\uFF0C\u4ECE\u5B9E\u9645\u9700\u6C42\u51FA\u53D1\uFF0C\u5F53\u6DF1\u5165\u4F53\u9A8C\u8FC7\u4EE5\u540E\uFF0C\u5176\u5B9E\u662F\u53EF\u4EE5\u6DF1\u5207\u611F\u53D7\u5230\u5DE5\u5177\u5E26\u6765\u7684\u7EA2\u5229\u3002\u82B1\u4E0A\u51E0\u5929\uFF0C\u4E00\u4E2A\u4EBA\u5C31\u53EF\u4EE5\u5B9E\u73B0\u524D\u540E\u7AEF\u5E94\u7528\uFF0C\u4EE5\u53CA\u8FD0\u7EF4\u76D1\u63A7\uFF0C\u62FF\u5230\u4E00\u5957\u53EF\u8FD0\u884C\u7684\u7A0B\u5E8F\u3002</p><p>\u968F\u7740\u884C\u4E1A\u5173\u6CE8\u5EA6\u7684\u63D0\u5347\u548C\u8D44\u6E90\u7684\u6295\u5165\uFF0C\u4E0A\u8FF0\u9047\u5230\u7684\u95EE\u9898\u5927\u591A\u53EF\u4EE5\u5F97\u5230\u89E3\u51B3\u3002<strong>\u4F4E\u4EE3\u7801\u4ECE\u201C\u53EF\u7528\u201D\u5230\u201C\u597D\u7528\u201D\u7684\u8FDB\u5316\uFF0C\u4E5F\u662F\u9700\u8981\u5728\u5B9E\u9645\u573A\u666F\u4E2D\u6478\u722C\u6EDA\u6253\u4E2D\u5386\u7EC3\u8FDB\u5316\u3002</strong></p><h2 id="\u76EE\u524D\u4F4E\u4EE3\u7801\u53D1\u5C55\u72B6\u51B5" tabindex="-1"><a class="header-anchor" href="#\u76EE\u524D\u4F4E\u4EE3\u7801\u53D1\u5C55\u72B6\u51B5" aria-hidden="true">#</a> \u76EE\u524D\u4F4E\u4EE3\u7801\u53D1\u5C55\u72B6\u51B5</h2><p>\u524D\u9762\u8BF4\u4E86\uFF0C\u4F4E\u4EE3\u7801\u7684\u70ED\u5EA6\u6301\u7EED\u63D0\u5347\uFF0C\u6700\u660E\u663E\u7684\u4E3E\u52A8\u5C31\u662F\u8D44\u672C\u771F\u91D1\u767D\u94F6\u7684\u6295\u8D44\u3002</p><p><img src="'+o+'" alt="demo"></p><p>\u53E6\u5916\u6709\u4E00\u4E2A\u4E3E\u52A8\u4E5F\u5F88\u5DE7\u5999\u3002\u9489\u9489\u53D1\u5E03\u4E86\u4E00\u4E2A\u4F4E\u4EE3\u7801\u805A\u5408\u5E73\u53F0\uFF0C\u5B9C\u642D\u3001\u6C1A\u4E91\u3001\u7B80\u9053\u4E91\u3001\u6613\u9CB8\u4E91\u7B49\u5934\u90E8\u4F4E\u4EE3\u7801\u5382\u5546\u5165\u9A7B\u3002\u9489\u9489\u62E5\u6709\u56FD\u5185\u6700\u5927\u7684\u5546\u52A1\u7528\u6237\u4EBA\u7FA4\uFF0C\u800C\u4F4E\u4EE3\u7801\u5728\u56FD\u5185\u6BD4\u8F83\u6210\u529F\u7684\u843D\u5730\u573A\u666F\u662F\u5B9A\u5236\u4F01\u4E1A\u7BA1\u7406\u7CFB\u7EDF\uFF08\u4F8B\u5982 CRM\uFF09\uFF0C<strong>\u5C06\u4F4E\u4EE3\u7801\u5E73\u53F0\u5BF9\u63A5\u5230\u5DE8\u5927\u7684\u5BF9\u53E3\u6D41\u91CF\u4E4B\u4E0A</strong>\uFF0C\u8FD9\u79CD\u5951\u5408\u7684\u64CD\u4F5C\u9887\u6709\u51E0\u5206\u5FAE\u4FE1\u63A5\u5165\u5FAE\u4FE1\u652F\u4ED8\u4E00\u822C\u75DB\u5FEB\u3002</p>',32),h=[n];function l(f,_){return a(),r("div",null,h)}var v=e(c,[["render",l],["__file","19.html.vue"]]);export{v as default};
